import React from "react";
import { WEDDING_DATE_DISPLAY } from "../constants/index.ts";
import heroImg from "../assets/Hero.png";
import frameSvg from "../assets/Frame.svg";
import "./HeroStyle.css";

export const Hero: React.FC = () => {
  return (
    <div className="hero-wrapper">
      <img
        className="hero-img"
        src={heroImg}
        alt="Andrew and Sofia"
      />
      <div className="hero-text">
        <img
          className="hero-decorative"
          src={frameSvg}
          alt="Decorative flourish"
        />
        <div className="hero-title">
          <div className="hero-name">Andrew</div>
          <div className="hero-ampersand">&</div>
          <div className="hero-name">Sofia</div>
        </div>
        <div className="hero-date">{WEDDING_DATE_DISPLAY}</div>
      </div>
    </div>
  );
};
